#include <stdio.h>
#include <stdlib.h>
#include <string.h>

struct LN {
	struct LN* pNext;
	char c;
	unsigned int idx;
};

int insert(struct LN** pHead, char c, unsigned int idx) {

	struct LN* pCur = *pHead;
	struct LN* pNode = malloc(sizeof(struct LN));

	pNode->pNext = NULL;
	pNode->c = c;
	pNode->idx = idx;

	if(*pHead == NULL) {
		*pHead = pNode;
		return 0;
	}

	while(pCur->pNext != NULL)
		pCur = pCur->pNext;

	pCur->pNext = pNode;
	return 0;

}

int dump(struct LN* pHead) {

	if(pHead == NULL) {
		printf("dump : List is NULL\n");
		return 0;
	}

	printf("dump : ");

	while(pHead != NULL) {
		printf("%c -> ",pHead->c);
		pHead = pHead->pNext;
	}
	printf("NULL\n");

	return 0;

}

unsigned char hash(char c) {
	return (c%126);
}

/**
 * Slicing window, for example
 * p w w k e w <= string s
 * 0 1 2 3 4 5 <=addr
 * for each s[i] in s
 *   if addr of strchr(s,s[i]) equal addr of s[i]
 *     it means s[i] is first appear
 *     => rlen = max( (addr of s[i] - addr of s + 1), rlen )
 *   if addr of strchr(s,s[i]) not equal addr of s[i]
 *     it means s[i] is not first appear
 *     => discard substring which ends with redundant s[i]
 *     => adjust i
 *     => rlen = max( (addr of s[i] - strchr(s,s[i])), rlen )
 *
 */
int lengthOfLongestSubstring(char* s) {
	
	int rlen = 0;
	int tmp = 0;

	int i = 0;
	char* pTmp = NULL;
	int strLen = 0;



	/*printf("string s address : 0x%08X \n", (unsigned int)s);
	printf("string s address : 0x%08X \n", &s[0]);
	printf("string s address : 0x%08X \n", &s[1]);*/
	strLen = strlen(s);
	for(rb=0;rb<strlen(s);rb++) {
		pTmp = strchr(s,s[rb]);

		if(pTmp != &s[rb]) {
			/*printf("%c has been appear \n", s[rb]);
			printf("pTmp : 0x%08x\n", (unsigned int)pTmp);
			printf("s[rb] : 0x%08x\n", (unsigned int)&s[rb]);*/
			tmp = (&s[rb] - pTmp);
			if(tmp > rlen)
				rlen = tmp;
			rb = rb - (pTmp - s + 1);
			s = (pTmp+1);
			//printf("string after discard : %s\n",s);
		} else {
			tmp = (&s[rb] - s) + 1;
			if(tmp > rlen)
				rlen = tmp;
			/*printf("%c is first appear \n", s[rb]);
			printf("s[rb] : 0x%08x\n", (unsigned int)&s[rb]);*/
		}
		//printf("%c : rlen : %d \n\n", s[rb], rlen);


	}
	return rlen;

}

